import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import { SHOP_NAME } from '../constant';
import logo from '../asset/image/logo.png';
import './navigation.css';

export default class Navigation extends React.Component {
    navbar = {backgroundColor: '#F16E10 !important'};
    render() {
        return <Navbar className="color-nav" expand="lg">
            <Navbar.Brand href="/">
                <img
                    src={logo}
                    width="270"
                    height="45"
                    className="d-inline-block align-top"
                    alt={SHOP_NAME}
                />
            </Navbar.Brand>
            <Navbar.Toggle  />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="justify-content-end" style={{ width: "100%" }} >
                    <Nav.Link tag={Link} eventKey={1} href="/">main</Nav.Link>
                    <Nav.Link tag={Link} eventKey={2} href="/second">second</Nav.Link>
                    {/* <LinkContainer to="/">
                        <NavItem eventKey={1}>main</NavItem>
                    </LinkContainer> */}
                    {/* <LinkContainer to="/second">
                        <NavItem eventKey={2}>second</NavItem>
                    </LinkContainer>  */}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    }

}
